    public static int lengthOfLongestSubstring(String s) {
        int[] cache = new int[256];
        Arrays.fill(cache, -1);
        int max = 0, start = 0;
        for (int i = 0; i < s.length(); i++) {
            char a = s.charAt(i);
            start = Math.max(cache[a] + 1, start);
            max = Math.max(max, i - start + 1);
            cache[a] = i;
        }
        return max;
    }
